// File: PatientProfile.js

import React from 'react';
import './PatientProfile.css';

const PatientProfile = ({ patient }) => {
  return (
    <div className="patient-profile">
      <h1>Thông tin hồ sơ bệnh nhân</h1>
      <div className="patient-info">
        <h2>Họ tên: <span>{patient.name}</span></h2>
        <p>Số chứng minh: <span>{patient.id}</span></p>
        <p>Giới tính: <span>{patient.gender}</span></p>
        <p>Sinh nhật: <span>{patient.birthdate}</span></p>
        <p>Số điện thoại: <span>{patient.phone}</span></p>
        <p>Email: <span>{patient.email}</span></p>
      </div>
      <div className="patient-records">
        <h2>Danh sách hồ sơ bệnh</h2>
        <ul>
          {patient.records.map((record, index) => (
            <li key={index}>{record}</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default PatientProfile;
